import React from "react";
import { Link } from "react-router-dom";
import '../App.css'

function Navbar() {
  return (
    <div>
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link to="/about" >Home</Link>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    </div>
  );
}

export default Navbar;
